import { Route, Switch } from 'react-router';
import './App.css';

import Login from './Component/UserControl/Login/Login';
import Register from "./Component/UserControl/Register/Register";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/" exact component={Login} />
        <Route path="/register" exact component={Register} />
      </Switch>
    </div>
  );
}

export default App;
